My Wife's Hot Friend - Amy Fisher 

Release Date: February 16, 2011

Amy is at her boss's house picking up a folder for her, when she is surprised by Tommy, her boss's husband. He is there with flowers and says &quot;Happy anniversary&quot; before realizing that it was Amy. He grills her on whether his wife talks about their anniversary, but Amy says she never mentioned it once. Now Tommy is bummed, and just gives Amy the flowers. He took the rest of the day off, he needs some cheering up, Amy looks smoking hot.....he has just convinced himself to do a little cheating. And of course Amy is a sucker for a married man who gives her flowers
